import React from "react";
import { Client, AccountId, PrivateKey, TokenCreateTransaction } from "@hashgraph/sdk";
import operator from "../config";
//
export default function mintButton() {
	return (
		<div>
			<button onClick={sayHi} className="cta-button connect-wallet-button">
				Connect to Wallet
			</button>
		</div>
	);

	async function sayHi() {
		console.log("Starting token creation");

		const tokenCreateTx = await new TokenCreateTransaction()
			.setTokenName("dAppDayToken")
			.setTokenSymbol("DDT")
			.setTreasuryAccountId(operator.id);

		console.log("Finished token creation");
	}
}
